import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  propsData = {};
  constructor(props) {
    super(props);
    this.state = {
      users: { selectPage: true, nameOne: "", nameTwo: "" },
    };
    this.playShou = this.playShou.bind(this);
  }
  render() {
    return (
      <div>
        {this.state.users.selectPage ? (
          <Users playShou={this.playShou} />
        ) : (
          <Play infoUsers={this.propsData} />
        )}
      </div>
    );
  }
  playShou = (date) => {
    this.setState({ selectPage: date.selectPage });

    this.propsData = {
      nameOne: date.nameOne,
      nameTwo: date.nameTwo,
      selectOneX: date.selectOneX,
    };
  };
}

export default App;
